    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>desc: &#39;Un CD audio intitulé &#34;Music from… Earth&#34;, diffusé par un label indépendant nommé &#34;Red Star Music Publishing&#34; et contenant six grands tubes internationaux des années 1970 à 2000 : //Candle In The Wind// (Elton John), //We Are The World// (USA For Africa), //YMCA// (Village People), //My Heart Will Go On// (Céline Dion), //Kung-Fu Fighting// (Carl Douglas) et //Believe// (Cher). Le &#34;livret&#34; du CD se résume à une simple feuille imprimée uniquement sur le recto, et le revers indique, outre la liste des titres et le nom de l&#39;&#39;éditeur, l&#39;&#39;accroche &#34;Please check the other titles in the //Music from…// collection: Ganymede, KOI-3284.01, Gliese 667 Cc, Kepler-62e, Tau Ceti e, and █████ ██ ██████.&#34;&#39;
day: &#39;31&#39;
month: &#39;10&#39;
loc: &#39;Bibliothèque Municipale de ██████████████████, France.&#39;
sec: &#39;Dans le bureau de l&#39;&#39;Agent Kaji.&#39;
note: &#34;Note : Je ne me lasse pas d&#39;écouter ces tubes venant d&#39;une époque où je n&#39;étais pas encore né, et où on savait encore faire de la bonne musique. Autre chose que ce que Holt nous fait subir toute la journée avec ses paquets de cigarettes, ses livres et ses chaises de bureau. Et j&#39;ai hâte de connaître les goûts musicaux des Képleriens. - Agent Kaji\nNote 2 : À chaque fois que j&#39;écoute Kung-Fu Fighting, j&#39;ai l&#39;irrépressible envie de foutre des tatanes aux gens que je croise… vous pensez que c&#39;est un effet anormal de l&#39;objet ? - Dr Benji&#34;
redirect-b: &#39;[[module Redirect destination=&#34;http://fondationscp.wikidot.com/liste-des-objets-anormaux/p/999#&#39;
redirect-e: &#39;&#34;]]&#39;</textarea></pre>
